import React, { Component } from 'react';
import AccountCircleIcon from '@material-ui/icons/AccountCircle';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';

import MenuIcon from '@material-ui/icons/Menu';
import { IconButton, TableRow, Container} from '@material-ui/core';

class Navbar extends Component {
    render() {
        return (
            <div>
                <nav class="navbar navbar-dark bg-dark">
                    <AppBar position="static">
                        <Toolbar>
                            <IconButton edge="start"  color="inherit" aria-label="menu">
                                <MenuIcon />
                            </IconButton>
                            <Typography variant="h6" >
                                News
    </Typography>
                            <Button color="inherit">Login</Button>
                        </Toolbar>
                    </AppBar>
                    <h2 style={{ color: "white", fontFamily: "papyrus" }}>EGBA Sistem</h2>
                    <IconButton aria-label="Add" onClick={this.showModal} style={{ rgin: 'auto', }}>
                        <AccountCircleIcon style={{ blockSize: "30", color: "white", fontSize: "2.5rem" }} />
                    </IconButton>
                </nav>
            </div>
        )
    }
}
export default Navbar;
